import "./main.css"
import Header from "../header/header"
import {connect} from "react-redux";

class Main extends Component {
    state = {
    };
    render() {
        const {articles} = this.props;
        return(
            <div className="">
                <Header/>
                <div className="main">
                    <div className="vverh w-100 d-flex">
                        <h4 className="font-weight-bold">Forbes Now</h4>
                        <span className="ml-4 mt-1">Asia Edition</span>
                    </div>
                    <div className="block d-flex mt-4">
                        <div className="block1 w-75">
                            <img className="block1_img" src={articles[0].urlToImage} alt="error"/>
                        </div>
                        <div className="block2 w-25">
                            <button></button>
                            <button></button>
                        </div>
                    </div>
                </div>
            </div>

        );
    }

}
const mapStateToProps = (state) => {
    return {
        articles: state.articles
    }
};
export default connect(mapStateToProps)(Main);
